import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

export default function Navbar() {
  return (
    <View style={styles.mai}>
      <View style={styles.container}>
        <Text style={styles.navItem}>Home</Text>
        <Text style={styles.navItem}>Men</Text>
        <Text style={styles.navItem}>Women</Text>
        <Text style={styles.navItem}>Electronics</Text>
        <Text style={styles.navItem}>Kids</Text>
        <Text style={styles.navItem}>Home-Decor</Text>
        <Text style={styles.navItem}>Profile</Text>
      </View>
      <View style={styles.logoContainer}>
        <Text style={styles.logo}>KMART</Text>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  mai: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    backgroundColor: 'orange',
    alignItems: 'center',
    paddingHorizontal: 10, // Add padding to the mai style
    height: 60, // Height of the navigation bar
  },
  container: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  navItem: {
    color: 'white',
    marginHorizontal: 10, // Add horizontal spacing between items
    fontSize: 18,
  },
  logoContainer: {
    alignItems: 'flex-end', // Align the logo to the right
  },
  logo: {
    color: 'white',
    fontSize: 18,
  },
});
